import { useRouter } from "next/router";
import withLayout from "../../components/MyLayout";

const Post = (props) => {
  const router = useRouter();
  return (
    <withLayout>
      <h5>{router.query.id}</h5>
      <h1>Title:</h1>
      <div></div>
    </withLayout>
  );
};

export default withLayout(Post);
